/*
* Bascule RS
* avec sorties 0/1 et T/F et inverted
*/

// initialise the memo to 0 if it doesn't exist already
//or get variable de contexte du noeud
var memo = context.get('memo')||0;

if (msg.payload == 1) {
    // reagit uniquement au front montant
    if (memo === 0) {
        memo = 1;
        output2 = true;
        output3 = false;
        node.status({fill:"green",shape:"dot",text:"True"});
    } else {
        memo = 0;
        output2 = false;
        output3 = true;
        node.status({fill:"red",shape:"ring",text:"False"});
    }
    // store the value back
    context.set('memo',memo);

    // make it part of the outgoing msg object
    var msg1 = {payload: memo};
    var msg2 = {payload: output2};
    var msg3 = {payload: output3};
    // fin et envoi
    return [msg1, msg2, msg3];
}
